import Usuario from "../models/Usuario";
import isLoggedIn from "../middlewares/securityMiddleware";
import bcrypt from "bcrypt";

const saltRounds = 12;

export function test(req, res) {
  console.log(req.body);
  res.send("dato recibido");
}

export function login(req, res) {
  if (req.body.username === "" || req.body.password === "") {
    res.send("login failed");
  } else {
    const usuario = req.body.username;
    const pass = req.body.password;
    Usuario.findOne({ where: { nombreusuario: usuario } }).then(user => {
      if (!user) {
        res.status(400).send("verifique el usuario o la contrasea");
      } else {
        bcrypt.compare(pass, user.password, (err, data) => {
          if (err) throw err;
          if (data) {
            
            res.status(200).send({'redirect':'/'});
          } else {
            res.status(401).send("verifique el usuario o la contrasea");
          }
        });
      }
    });
  }
}

